import { useState, useEffect } from "react";
import OrderService from "../../services/order.service";
import ModelService from "../../services/models.service";
import "./CreateOffer.css";

export const CreateOffer = () => {
  const [transmissions, setTransmissions] = useState([]);
  const [categories, setCategories] = useState([]);
  const [engines, setEngines] = useState([]);
  const [vwModels, setVwModels] = useState([]);
  const [brands, setBrands] = useState([]);

  useEffect(() => {
    OrderService.getTransmissions().then((transmissions) =>
      setTransmissions(transmissions.data)
    );

    OrderService.getCategories().then((category) =>
      setCategories(category.data)
    );

    OrderService.getEngines().then((engine) => setEngines(engine.data));

    ModelService.getModelsFromBrandVw().then((model) =>
      setVwModels(model.data)
    );

    OrderService.getBrands().then((brand) => setBrands(brand.data));
  }, []);

  console.log(vwModels);

  const onCreate = (e) => {
    e.preventDefault();

    const formData = new FormData(e.target);
    const { title, price, imageUrl, kilometers, year, description, model } =
      Object.fromEntries(formData);

    const category = e.target[2].value;
    const engine = e.target[5].value;
    const transmission = e.target[6].value;

    const orderData = {
      title,
      price,
      imageUrl,
      kilometers,
      year,
      description,
      model,
      transmission,
      engine,
      category,
    };

    console.log(orderData);

    // OrderService.createOrder(orderData);
  };

  return (
    <div className="register">
      <div className="row">
        <div className="col-md-3 register-left">
          <img src="https://image.ibb.co/n7oTvU/logo_white.png" alt="" />
          <h3>Welcome</h3>
          <p>You are 30 seconds away from earning your own money!</p>
          <input type="submit" name="" value="Catalog" />
          <br />
        </div>

        <div className="col-md-9 register-right">
          <div className="tab-content" id="myTabContent">
            <div
              className="tab-pane fade show active"
              id="home"
              role="tabpanel"
              aria-labelledby="home-tab"
            >
              <h3 className="register-heading">Create your Offer</h3>
              <form onSubmit={onCreate}>
                <div className="row register-form">
                  <div className="col-md-6">
                    <div className="form-group-1">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Product Title *"
                        name="title"
                      />
                    </div>
                    <div className="form-group-1">
                      <input
                        type="text"
                        className="form-control"
                        placeholder="Price *"
                        name="price"
                      />
                    </div>
                    <div className="form-group-1">
                      <select className="form-control">
                        <option className="hidden">
                          Please select Category *
                        </option>
                        {categories.map((category) => (
                          <option
                            key={category}
                            value={category}
                            name={category}
                            id={category}
                          >
                            {category}
                          </option>
                        ))}
                      </select>
                    </div>
                    <div className="form-group-1">
                      <select className="form-control">
                        {brands.map((key, value) => (
                          <optgroup label={key.name}>
                            <option
                            // key={brand.models.id}
                            // value={brand.models.name}
                            // name={brand.models.name}
                            // id={brand.models.name}
                            >
                              {value.name}
                            </option>
                          </optgroup>
                        ))}
                      </select>
                    </div>
                    <div className="form-group-1">
                      <select className="form-control">
                        <option className="hidden" defaultValue>
                          Please select Model
                        </option>
                        <option>What is your Birthdate?</option>
                        <option>What is Your old Phone Number</option>
                        <option>What is your Pet Name?</option>
                      </select>
                    </div>
                    <div className="form-group-1">
                      <select className="form-control">
                        <option className="hidden" defaultValue>
                          Please select Engine type
                        </option>
                        {engines.map((engine) => (
                          <option key={engine} value={engine}>
                            {engine}
                          </option>
                        ))}
                      </select>
                    </div>
                  </div>
                  <div className="col-md-6">
                    <div className="form-group-1">
                      <select className="form-control">
                        <option className="hidden" defaultValue>
                          Please select Transmission
                        </option>
                        {transmissions.map((transmissions) => (
                          <option key={transmissions} value={transmissions}>
                            {transmissions}
                          </option>
                        ))}
                      </select>
                    </div>
                    <div className="form-group-1">
                      <input
                        type="text"
                        name="vehicleIdentificationNumber"
                        className="form-control"
                        placeholder="Vehicle Identification Number *"
                      />
                    </div>
                    <div className="form-group-1">
                      <input
                        type="text"
                        name="year"
                        className="form-control"
                        placeholder="Year *"
                      />
                    </div>
                    <div className="form-group-1">
                      <input
                        type="text"
                        name="imageUrl"
                        className="form-control"
                        placeholder="Image Url"
                      />
                    </div>
                    <div className="form-group-1">
                      <input
                        type="text"
                        name="kilometers"
                        className="form-control"
                        placeholder="Kilometers"
                      />
                    </div>
                    <div className="form-group-1">
                      <textarea
                        type="text"
                        className="form-control"
                        placeholder="Description"
                        name="description"
                      />
                    </div>
                    <input type="submit" className="btnRegister" />
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
